import React, { useState } from 'react'
import UnitsAges from './UnitsAges';

const UnitsList = (props) => {

  let [filteredAge, setFilteredAge] = useState('All');

  const AgesFilterHandler = selectedAge => {
    setFilteredAge(selectedAge)
  };

  return (
    <div>
    <UnitsAges selected={filteredAge} onChangeFilter={AgesFilterHandler}/>
    <li>
            <h2>{props.id}</h2>
            <h3>{props.name}</h3>
            <p>{props.age}</p>
        </li>
        </div>
  );
};

export default UnitsList;
